import React from 'react';
import './App.css';

const Menu6 = () => {
  return (
    <section className='menu6'>
      <div></div>
      <div className='menu6end'>
        <div className='menu6end2'>
          <h2>Ready to talk?</h2>
          <input type='text' placeholder='name' />
          <input type='email' placeholder='email' />
          <span>
            <b>CONTACT US</b>
          </span>
        </div>
      </div>
    </section>
  );
};

export default Menu6;
